import React, { useState } from "react";
import api from "./axiosConfig";
import { useNavigate } from "react-router-dom";
import "./AdminRegister.css";

const AdminRegister = () => {
  const navigate = useNavigate();

  const [Username, setUsername] = useState("");
  const [Password, setPassword] = useState("");
  const [Name, setName] = useState("");
  const [error, setError] = useState("");

  const handleAdminRegister = async (e) => {
    e.preventDefault();

    try {
      await api.post("AdminLogin/register", {
        Username,
        Password,
        Name,
      });
      localStorage.setItem("adminName", Name);

     // navigate("/AdminLogin");
      navigate("/AdminDashboard")
    } catch {
      setError("Admin registration failed");
    }
  };

  return (
 
    <div className="adminreg-container">
       <header>
      Welcome {}
    </header>
      <form className="adminreg-box" onSubmit={handleAdminRegister}>
        <h2 className="adminreg-title">Admin Register</h2>

        {error && <p className="adminreg-error">{error}</p>}

        <input
          type="text"
          placeholder="Name"
          value={Name}
          onChange={(e) => setName(e.target.value)}
        />

        <input
          type="text"
          placeholder="Username"
          value={Username}
          onChange={(e) => setUsername(e.target.value)}
        />

        <input
          type="password"
          placeholder="Password"
          value={Password}
          onChange={(e) => setPassword(e.target.value)}
        />

        <button type="submit" className="adminreg-btn">
          Register
        </button>

        <button
          type="button"
          className="adminreg-secondary-btn"
          onClick={() => navigate("/AdminLogin")}
        >
          Back to Login
        </button>
      </form>
    </div>
  );
};

export default AdminRegister;
